import React, { Component, Fragment } from 'react';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    //NavLink,
    Container
} from 'reactstrap';



export class AppNavbar extends Component {
    state = {
        isOpen : false
    }

    toggle = () => {
        this.setState({
            isOpen : !this.state.isOpen
        });
    }
    render() {
        return (
            <div>
                <Navbar style={{backgroundColor: '#ffdbe9'}} expand="sm" className="navbar">
                <Container>
                    <NavbarBrand href="/" style={{fontFamily: 'Barriecito', color: '#000', fontSize: "150%"}}>Shosh Cakes</NavbarBrand>
                    <NavbarToggler onClick={this.toggle} />
                    <Collapse isOpen={this.state.isOpen} navbar>
                        <Nav className="ml-auto" navbar>github</Nav>
                    </Collapse>
                </Container>
            </Navbar>
            </div>
        )
    }
}

export default AppNavbar;
